import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Typography, Button, Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';

const CSB02 = () => {
    const [exams, setExams] = useState([]);

    // Fetch data from the Exam API
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:9999/Exam');
                setExams(response.data);
            } catch (error) {
                console.error('Error fetching exams:', error);
            }
        };

        fetchData();
    }, []);

    // Handle actions
    const handleAction = async (examId, status) => {
        const isConfirmed = window.confirm(`คุณต้องการ ${status === 'ยินยอม' ? 'ยินยอม' : 'ปฏิเสธ'} การสอบ CSB02 ใช่หรือไม่?`);
        if (isConfirmed) {
            try {
                await axios.post('http://localhost:9999/Exam', {
                    P_id: examId,
                    Exam_CSB02_status: status
                });
                alert('สถานะการสอบ CSB02 ถูกอัพเดตแล้ว');
                // Refresh the data
                const response = await axios.get('http://localhost:9999/Exam');
                setExams(response.data);
            } catch (error) {
                console.error('Error updating status:', error.response ? error.response.data : error.message);
                alert('ไม่สามารถอัพเดตสถานะการสอบ CSB02 ได้');
            }
        }
    };

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    {exams.map(exam => (
                        <Grid container key={exam.Exam_id} alignItems="center" justifyContent="space-between">
                            <Grid item>
                                <Typography variant="h1">
                                    การยื่นก้าวหน้า โครงงานพิเศษ 1
                                    <Typography variant="subtitle1">
                                        ชื่อการสอบ: {exam.Exam_name}<br />
                                        ห้องสอบ: {exam.Exam_room}<br />
                                        สถานะการเปิด: CSB01 - {exam.Exam_o_CSB01}, CSB02 - {exam.Exam_o_CSB02}, CSB03 - {exam.Exam_o_CSB03}<br />
                                        สถานะ CSB01: {exam.Exam_CSB01_status}<br />
                                        สถานะ CSB02: {exam.Exam_CSB02_status}<br />
                                        สถานะ CSB03: {exam.Exam_CSB03_status}
                                        <Grid container spacing={2}>
                                            <Grid item>
                                                <Button variant="contained" color="error" onClick={() => handleAction(exam.Exam_id, 'ปฏิเสธ')}>
                                                    ปฏิเสธ
                                                </Button>
                                            </Grid>
                                            <Grid item>
                                                <Button variant="contained" color="success" onClick={() => handleAction(exam.Exam_id, 'ยินยอม')}>
                                                    ยินยอม
                                                </Button>
                                            </Grid>
                                        </Grid>
                                    </Typography>
                                </Typography>
                            </Grid>
                        </Grid>
                    ))}
                </Grid>
            </Grid>
        </MainCard>
    );
};

export default CSB02;
